import React from "react";
import Buzzes from "../components/Buzzes";
import { useBuzzContext } from '../hooks/useBuzzContext';

const Home = () => {
  const { buzz, dispatch } = useWorkoutsContext();
  const { user } = useAuthContext();
  useEffect(() => {
    if (user) {
      fetchWorkouts();
    }
  }, [dispatch, user]);
  return <div className="ml-64"></div>;
};

export default Home;
